import React from 'react';
import { Button } from '@material-ui/core';
import { Link } from 'react-router-dom';

const SignOutButton = () => (
  <Button
    className="float-right"
    variant="contained"
    color="primary"
    component={Link}
    to="/signin"
    style={{ marginLeft: "auto" }}
  >
    Sign Out
  </Button>
);

export default SignOutButton;
